            <h1>
              Здравствуй, {this.props.name}! 
            </h1>
          );
    }
    render() {
        return (
            <div >
                    <div id="im">
                        <img className="foto" src={this.props.photo} onClick={this.press} />
                         <p>{this.props.name}</p> 
                    </div>
            </div>
        );
    }
}

